import React from 'react'
import classes from './MealsSummery.module.css'

const MealsSummery = () => {
  return (
    <div className={classes.summary}>
        <h2>Delicious Food, Delivered To You</h2>
        <p>Chose your favorite meal from our broad selection of available meals and enjoy a delicious lunch or dinner at home</p>
        <p>All our melas are cooked with high-quailty ingredients, just-in-time and of course by exprienced chefs!!</p>
    </div>
  )
}

export default MealsSummery
